import {
    MDBTableBody
} from "mdb-react-ui-kit";

export default function TableRows({ key, item }) {
    return (

        <MDBTableBody key={index}>
            <tr>
                <th scope='row'>{index + 1}</th>
                <td>{item.name}</td>
                <td>{item.email}</td>
                <td>{item.phone}</td>
                <td>{item.address}</td>
                <td>{item.id}</td>
                <td>{item.status}</td>
            </tr>
        </MDBTableBody>
    );
}
